import React from "react";

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>Total</th>
      </tr>
    </thead>
  );
};

const TableBody = () => {
  return (
    <tbody>
      <tr>
        <td>Food</td>
        <td>50</td>
      </tr>
      <tr>
        <td>House</td>
        <td>150</td>
      </tr>
      <tr>
        <td>Car</td>
        <td>70</td>
      </tr>
    </tbody>
  );
};

class Table extends React.Component {
  render() {
    return (
      <table>
        <TableHeader />
        <TableBody />
      </table>
    );
  }
}

export default Table;
